import React from 'react'
import nouthern from './image/nouthern.jpg'
import Southern from './image/Southern.jpg'

const DisplayHemisphere = (props) => {
    const { latitude } = props;

    const hemisphere = latitude > 0 ? 'Northern hemisthere' : 'Southern hemisphere'
    const picture = latitude > 0 ? nouthern : Southern
    return (

        <div>
            <img src={picture} alt='Lỗi hình ảnh' />
            {hemisphere}
        </div>
    )
}

export default DisplayHemisphere;
